import React from 'react';
import '../App.css';
import { Button } from './Button';
import './HeroSection.css';
import {SocialIcon} from "react-social-icons"

function HeroSection() {
  return (
    <div className='hero-container'>
      <video src='/videos/video-1.mp4' autoPlay loop muted />
      <h1 className = "port">Welcome to my Portfolio</h1>
      
      <div className='hero-btns'>
        <Button
          className='btns'
          buttonStyle='btn--outline'
          buttonSize='btn--large'
          to = '/products'
        >
          View Projects
        </Button>
        <div className >


        <SocialIcon url= "https://github.com/BLara408" className="hero-container" target="blank" fgColor= "#ffff" style ={{height: 45, width: 45}} />
        <SocialIcon url= "https://www.linkedin.com/in/brandon-lara-23b3a0142/" className="" target="blank" fgColor= "#ffff" style ={{height: 45, width: 45}} />
        </div>
       
      </div>
    </div>
  );
}

export default HeroSection;
